import { Box } from "@mui/system";
import React from "react";
import "./Quote.css";
const Quote = () => {
  return (
    <Box
      className="bg"
      style={{
        height: "50px",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <Box
        style={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          width: "800px",

          overflow: "auto",
        }}
      ></Box>
    </Box>
  );
};

export default Quote;
